import { createRegister } from "../services/LoginServices";

const Users = async (state = [], action) => {
    console.log(state, action);
    let newSate = [...state];

    switch (action.type) {
        case "CREATE_REGISTER":
            const result = await createRegister(
                [...newSate, {
                    id: Date.now(),
                    info: action.info
                }]);
            return result;

        default:
            return state;
    }

}
export default Users;
